import React from "react";
import TodoList from "./components/TodoList";


function App(){

  return (
    <div>
      <TodoList></TodoList>
      <input type="text"></input>
      <button>Add to Do</button>
      <button>Clear Completed Todos</button>
      <div>0 left to do</div>
    </div>
  )

}
export default App
